import React from 'react'
import styled from 'styled-components';

const Foot = styled.footer`

  margin-top: 1rem;
  padding: 1rem;
  background-color: rgb(235, 195, 64);
  /* position: fixed; */
  bottom: 0;
  left: 0;
  width: 100%;
`

const Footer = () => {

    const today = new Date();

  return (
    <Foot>
        <p>Copyright &copy; {today.getFullYear()}</p>
    </Foot>
  )
}

export default Footer
